import React from "react";
import {useForm} from 'react-hook-form';

const Form = () => {

  const {register, handleSubmit, error} = useForm()

  const onSubmit = (data) => {
    console.log(data);
  }

  return (
    <div className="main__wrapper">
      <h3 className="text-red-500 ">Form</h3>

      <form className="form" onSubmit={handleSubmit(onSubmit)}>
        {/* <label className="form__label"> */}
          <input className="form__label" {...register("firstname", {required: true, maxLength: 20})} />
        {/* </label> */}

        <label className="form__label">
          <input {...register("lastName", {required: true, maxLength: 20, pattern: /^[A-Za-z]+$/i})} />
        </label>

        {/* <label className="form__label"> */}
            <input  className="form__label" type="number" {...register("age", {required: true, min:18, max: 99})}/>
        {/* </label> */}

        <input type="submit" value="Submit" className="btn btn-primary"/>

      </form>
    </div>
  )
}

export default Form;
